(function($,Drupal,once){Drupal.behaviors.webformExcludedElementsComposite={attach:function(context){$(once('webform-excluded-elements','.form-type-webform-excluded-elements [data-composite] input[type="checkbox"]')).on('click',function(){var checked=this.checked;var compositeKey=this.value;$(this).closest('table').find('[data-composite-parent="'+compositeKey+'"]').each(function(){$(this).toggleClass('selected',checked);$('input:checkbox',this).attr('disabled',!checked).prop('checked',checked)})})}}})(jQuery,Drupal,once)